def main():
    print("Hello World!")
    x = ""
    print(len(x))
    start = "ATG"
    stop = ["TAG", "TAA", "TGA"]
    index = x.index(start)
    sequence = x[index:]

    for i, letter in enumerate(sequence):
        if i % 3 == 0:
            if sequence[i:i+3] in stop:
                print("ORF start:", index)
                print("ORF end:", i + index)
                print(i / 3)
                break


if __name__ == "__main__":
    main()
